import { Cookies } from 'react-cookie';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';

//components

const cookies = new Cookies();

const dashboard = () => {
    return (
        <Layout>
            <div className='main'>
                <Container fluid>
                    <Row>
                        <div>
                            <img src=''/>
                        </div>
                        <div>Hola</div>
                    </Row>
                    <Row></Row>
                </Container>
            </div>
            <style global jsx>{`
                *{
                    box-sizing: border-box;
                }
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                    margin:0; padding:0;
                }

                .main{
                    border: 1px solid;
                    width: 100%;
                    height: 100%;
                    background: #C2C0C0;
                }

                .row-1{
                    width: 100%;
                    height: 5%;
                    margin: 0;
                    padding: 0;
                }
                .row-2{
                    width: 100%;
                    height: 95%;
                    margin: 0;
                    padding: 0;
                }

            `}</style>
        </Layout>
    );
}

export default dashboard;
